        <div class="flex justify-center mb-20 md:justify-between">
          <h2 class="text-4xl text-center font-alata uppercase md:text-left md:text-5xl">
            OUR CARS
          </h2>

          <input type="text" class="flex-1 p-3 border-2 rounded-lg placeholder-purple-500 focus:outline-none" placeholder="Search for a car here" id="search-input"/>
        </div>
      </div>
    </section>
  );
};
